import logo from './logo.svg';
import './App.css';
import './components/NavCustom.js';

import Container from 'react-bootstrap/Container';
import NavCustom from './components/NavCustom.js';
import Card from 'react-bootstrap/Card';


function HomeContent(){
  return (
    <div expand>
      <Card style={{width:'18rem'}}>
        {/* <Card.Header>The title</Card.Header> */}
        <Card.Body>
          <Card.Title className='text-dark'>The title goes here</Card.Title>
          <Card.Text className='text-dark'>Why does everyone hate me ?</Card.Text>
        </Card.Body>
        </Card>
    </div>
  );
}


function App() {
  return (

    <div className="App">   
      <header className="App-header">
        <NavCustom/>
      </header>
      <body className='App-body ww-100 text-white'>


        <HomeContent />
      </body>
    </div>
  );
}

export default App;
